import React, { Component } from 'react';
import { Form, Icon, Input, Button, message } from 'antd';
import { Link } from "react-router-dom";
import { Typography } from 'antd';

import { history } from '../History';
import { serverUrl } from '../setting';

const { Title } = Typography;

class MyGroupMember extends Component {

  render() {
      return (
          <span>
              <center>
                  {/* 버튼 */}
                  <Button Button shape="circle" icon="fire" onClick={this.showModal} style={{ fontSize: '25px' }} size="large"/>
                  {/* 뜨는 창 */}
                  <Modal
                      title="약품 추가"
                      visible={this.state.visible}
                      onOk={this.handleOk}
                      onCancel={this.handleCancel}
                  >
                      {/* 정보 출력  */}
                      여기에 약품이름 검색창 <br/>
                      검색된거 정보 <br/>
                      <ChemicalInfo chemical={{ chemicalName : "added chemical"}} />
                      별칭 설정 <br/>
                      장소 선택 <br/>
                      등등 버튼 추가하기
                  </Modal>
              </center>
              <center>
                  약품 추가하기
              </center>
          </span>
      );
  }
}

export default Form.create()(MyGroupMember);
